description:
Bomb Hunters

Sociopolitical Documentary hosted by Chris Hunter, published by History Channel in 2011 - English narration


Information
------------------------------

Former army bomb disposal expert Chris Hunter goes inside the mind of both bomb maker and bomb hunter, revealing the deadly game of cat and mouse surrounding Improvised Explosive Devices.
Introduction by Lord Ashcroft.
Produced by Empire Media Productions.

